function Blogs() {
  const [expandedBlog, setExpandedBlog] = useState(null);
  const [expandedRecommendedBlog, setExpandedRecommendedBlog] = useState(null);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const handleOpenModal = (blog) => {
    setExpandedBlog(blog);
  };

  const handleOpenRecommendedModal = (blog) => {
    setExpandedRecommendedBlog(blog);
  };

  const handleCloseModal = () => {
    setExpandedBlog(null);
    setExpandedRecommendedBlog(null);
  };

  return (
    <>
      <Navbar />
      <div className="min-h-screen bg-gradient-to-br from-sky-100 to-teal-100 text-gray-700 p-8">
        <h1 className="text-4xl font-bold text-center my-5 text-[#04373A] uppercase">Our Blog</h1>
        <div className="flex flex-wrap justify-center">
          <div className="w-full md:w-1/3 lg:w-1/4">
            <h2 className="text-2xl font-bold text-center m-5 p-5 text-white bg-[#0A8EA8]">Recommended Blogs</h2>
            <div className="space-y-6 mx-5 mt-5">
              {recommendedblogs.map((blog, index) => (
                <div
                  key={index}
                  className="bg-white rounded-lg shadow-md p-6 hover:shadow-lg transition-shadow duration-300"
                >
                  <h2 className="text-2xl font-semibold mb-2">{blog.title}</h2>
                  <p className="text-gray-600">{blog.excerpt}</p>
                  <button
                    onClick={() => handleOpenRecommendedModal(blog)}
                    className="mt-4 text-[#0A8EA8] hover:underline cursor-pointer"
                  >
                    View Full Content
                  </button>
                </div>
              ))}
            </div>
          </div>

          <div className={`w-full ${isMobile ? 'hidden' : 'w-2/3'} p-5`}>
            <h2 className="text-2xl font-bold text-center mb-5 text-white bg-[#0A8EA8]">All Blogs</h2>
            <div className="space-y-6">
              {blogs.map((blog, index) => (
                <div
                  key={index}
                  className="bg-white rounded-lg shadow-md p-6 hover:shadow-lg transition-shadow duration-300"
                >
                  <h2 className="text-2xl font-semibold mb-2">{blog.title}</h2>
                  <p className="text-gray-600">{blog.excerpt}</p>
                  <button
                    onClick={() => handleOpenModal(blog)}
                    className="mt-4 text-[#0A8EA8] hover:underline cursor-pointer"
                  >
                    View Full Content
                  </button>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      <Footer />

      {/* Modal for Recommended Blogs */}
      <Modal
        isOpen={Boolean(expandedRecommendedBlog)}
        onClose={handleCloseModal}
        title={expandedRecommendedBlog?.title}
        content={expandedRecommendedBlog?.content}
      />

      {/* Modal for All Blogs */}
      <Modal
        isOpen={Boolean(expandedBlog)}
        onClose={handleCloseModal}
        title={expandedBlog?.title}
        content={expandedBlog?.content}
      />
    </>
  );
}

export default Blogs;